// parse JSON and save into variable gridDefinition
gridDefinition = JSON.parse(gridDefinition);

function createModule(m, svgNS) {
    let wpos = m.wpos;
    let txid = m.txid;

    let mid_x = wpos[0];
    let mid_y = wpos[1];
    let w = wpos[3];
    let h = wpos[4];

    // creating 8 triangles into one module
    let module = document.createElementNS(svgNS, 'g');
    module.setAttribute('stroke','#aaa');
    module.setAttribute('fill', 'transparent');
    module.setAttribute('stroke-width','0.01');
    module.setAttribute('id', 'txid' + txid);
    for (i = 1; i <= 8; i++) {
        // create a specific triangle with the current coordinates
        module.appendChild(getTriangle(i, module.namespaceURI, {'mid_x': mid_x, 'mid_y': mid_y, 'w': w, 'h': h}));
    }

    // drawing rectangle (only for visualisation)
    let rect = document.createElementNS(module.namespaceURI, 'rect');
    rect.setAttribute('stroke', 'gray');
    rect.setAttribute('stroke-width', '0.03');
    rect.setAttribute('fill', 'transparent');
    rect.setAttribute('x', (mid_x - (w/2)));
    rect.setAttribute('y', (mid_y - (h/2)));
    rect.setAttribute('width', w);
    rect.setAttribute('height', h);

    module.appendChild(rect);
    return module;
}

// render all grids in svg according to information from JSON
function renderGrid(grid) {
    let modules = grid.modules;
    let svg = document.getElementById('root');
    let i;

    for (i = 0; i < modules.length; i++) {
        svg.appendChild(createModule(modules[i], svg.namespaceURI));
    }
}

// create a specific triangle with the current coordinates
function getTriangle(i, svgNS, rectangle) {
    let triangle = document.createElementNS(svgNS, 'polygon');
    let {mid_x, mid_y, w, h} = rectangle;
    let middle = mid_x + ',' + mid_y;
    let angle1;
    let angle2;

    switch (i) {
        case 1:
            angle1 = (mid_x + (w/2)) + ',' + (mid_y + (h/2));
            angle2 = mid_x + ',' + (mid_y + (h/2));
            break;
        case 2:
            angle1 = (mid_x + (w/2)) + ',' + mid_y;
            angle2 = (mid_x + (w/2)) + ',' + (mid_y + (h/2));
            break;
        case 3:
            angle1 = (mid_x + (w/2)) + ',' + (mid_y - (h / 2));
            angle2 = (mid_x + (w/2)) + ',' + mid_y;
            break;
        case 4:
            angle1 = mid_x + ',' + (mid_y - (h / 2));
            angle2 = (mid_x + (w/2)) + ',' + (mid_y - (h / 2));
            break;
        case 5:
            angle1 = (mid_x - (w /2)) + ',' + (mid_y - (h / 2));
            angle2 = mid_x + ',' + (mid_y - (h / 2));
            break;
        case 6:
            angle1 = (mid_x - (w /2)) + ',' + mid_y;
            angle2 = (mid_x - (w /2)) + ',' + (mid_y - (h / 2));
            break;
        case 7:
            angle1 = (mid_x - (w /2)) + ',' + (mid_y + (h/2));
            angle2 = (mid_x - (w /2)) + ',' + mid_y;
            break;
        case 8:
            angle1 = mid_x + ',' + (mid_y + (h/2));
            angle2 = (mid_x - (w /2)) + ',' + (mid_y + (h/2));
            break;
        default:
    }
    triangle.setAttribute('points', (middle + ' ' + angle1 + ' ' +  angle2));
    triangle.setAttribute('class', 'c' + i);
    triangle.setAttribute('fill', 'black');
    return triangle;
}

// waiting for modules to load
window.onload = (e) => {
    renderGrid(gridDefinition);
};

let client = io.connect("http://158.196.218.88:8000/");

client.on("messages-raw", function(rawMessages)
{   
    //console.log(rawMessages)

    moduleInfo = rawMessages[0];

    //check GROUP ID validity 
    if (moduleInfo[2] != 70) return;

    // mapping of X, Y coordinates to the parameter txid in JSON
    identificator = (moduleInfo[3] << 8) | moduleInfo[4];
    let module = document.getElementById('txid' + identificator);

    // capacity value mapping to grayscale
    for (i = 1; i < 9; i++) {
        let triangleShow = module.getElementsByClassName('c' + i)[0];
        // calculating gray value - interval 0 - 255;
        let gray = (moduleInfo[i + 8] - 128) * 2;
        triangleShow.setAttribute('fill', 'rgb('+ gray + ',' + gray +',' + gray + ')');
    };
});